export const links = [
	{
		name: 'Home',
		submenu: false,
		menuLink: '/',
		sublinks: [
			{
				Head: false,
				sublink: [{ name: '', link: '' }],
			},
		],
	},
	{
		name: 'Company',
		menuLink: '',
		submenu: true,
		sublinks: [
			{
				Head: '',
				sublink: [
					{ name: 'About', link: '/' },
					{ name: 'Testimonial', link: '/' },
					{ name: 'Carear With Us', link: '/' },
					{ name: 'Quote', link: '/' },
					{ name: 'RFP', link: '/' },
				],
			},
		],
	},
	{
		name: 'Service',
		menuLink: '',
		submenu: true,
		sublinks: [
			{
				Head: 'Software Development',
				sublink: [
					{ name: 'Saas Software Development', link: '/' },
					{ name: 'Custom Software', link: '/' },
					{ name: 'Development', link: '/' },
				],
			},
			{
				Head: 'Mobile Application',
				sublink: [
					{ name: 'Mobile App Development', link: '/' },
					{ name: 'IOS Mobile App', link: '/' },
				],
			},
			{
				Head: 'Consultancy',
				sublink: [{ name: 'It Consultancy Services', link: '/' }],
			},
			{
				Head: 'On-Demand App',
				sublink: [
					{ name: 'On-Demand App', link: '/' },
					{ name: 'Development', link: '/' },
				],
			},
		],
	},
	{
		name: 'Blog',
		submenu: false,
		menuLink: '/blog',
		sublinks: [
			{
				Head: '',
				sublink: [{ name: '', link: '' }],
			},
		],
	},
	{
		name: 'Training',
		submenu: false,
		menuLink: '/training',
		sublinks: [
			{
				Head: '',
				sublink: [{ name: '', link: '' }],
			},
		],
	},
	{
		name: 'Contact',
		submenu: false,
		menuLink: '/contact',
		sublinks: [
			{
				Head: '',
				sublink: [{ name: '', link: '' }],
			},
		],
	},
	{
		name: 'Account',
		menuLink: '',
		submenu: true,
		sublinks: [
			{
				Head: '',
				sublink: [
					{ name: 'Login', link: '/signin' },
					{ name: 'Register', link: '/signup' },
				],
			},
		],
	},
	{
		name: 'RFP',
		submenu: false,
		menuLink: '/',
		sublinks: [
			{
				Head: '',
				sublink: [{ name: '', link: '' }],
			},
		],
	},
];
